import React, { useState } from "react";
import { UserBox, LogoBtn, NameDiv } from "./style";

const UserComponent = () => {
  const [data, setData] = useState([]);
  const token =
    "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyX2lkIjoiNjNiYmQ1ZWY3NDVhNmNmNTE5ZWE3ZDQyIiwiaWF0IjoxNjc0MTMxNzU1LCJleHAiOjE2NzY3MjM3NTV9.4-kTHPyMq1DYGsBgm2fGnOETVyCKpAUS5-DKWqyiGlU";
  fetch("http://172.105.41.247:5004/api/v1/chats?page_no=1&limit=10", {
    method: "GET",
    headers: { Authorization: `Bearer ${token}` },
  })
    .then((res) => res.json())
    .then((result) => {
      setData(result.result.data);
      console.log(result.result.data);
    });
  return (
    <>
      {data.map((elm) => {
        return (
          <>
            <UserBox>
              <LogoBtn>vk</LogoBtn>
              <NameDiv>
                <p>
                  <span style={{ fontSize: "20px" }}> {elm.member_users[0]}</span>
                  <br />
                  last massage
                </p>
              </NameDiv>
            </UserBox>
          </>
        );
      })}
    </>
  );
};
export default UserComponent;
